import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import DeleteForeverRoundedIcon from '@material-ui/icons/DeleteForeverRounded';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Fab from '@material-ui/core/Fab';
import { useDispatch } from 'react-redux';
import { unlikeCountry } from '../../redux/actions';

const useStyles = makeStyles({
    flag: {
        width: "50px",
        heigth: "30px"
    }
})
function FavCountry({ country }) {
    const classes = useStyles();
    const { flag, name } = country;
    const dispatch = useDispatch();

    const unlike = () => {
        dispatch(unlikeCountry(country))
    }

    return (
        <ListItem component="nav">
            <ListItemIcon>
                <img src={flag} className={classes.flag} alt={`${name}'s flag`} />
            </ListItemIcon>
            <ListItemText primary={name} />
            <Fab
                onClic={unlike}
                size="small"
                color="secondary"
                aria-label="remove">
                <DeleteForeverRoundedIcon />
            </Fab>

        </ListItem>
    )
}

export default FavCountry;
